import styled from 'styled-components';
import blinkyIcon from '../assets/blinkyIcon.png';
import batteryFull from '../assets/batteryFull.svg';
import batteryEmpty from '../assets/batteryEmpty.svg';

const navBarStyle = {
  backgroundColor: '#FF9999',
  width: '100%',
  height: '15vh',
  color: '#FFFFFF',
  padding: '10px',
  boxSizing: 'border-box',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  gap: '20px',
  borderBottom: '2px solid #FFBEBE'
}

const HeaderComponent = styled.div`
  display: flex;
  justify-content: align-items;
`

const imgStyle = {
  height: '14vh'
}

const NavBar = ({charge}) => {
  return <>
    <header style={navBarStyle}>
      <HeaderComponent>
        <img src={blinkyIcon} alt={'robot icon'} style={imgStyle}/>
        <h1>Blinky the HSR</h1>
      </HeaderComponent>
      <HeaderComponent>
        {charge > 50 ? 
          <img src={batteryFull} alt={'Full battery'}/>
          : <img src={batteryEmpty} alt={'Full battery'}/>
        }
      </HeaderComponent>
    </header>
  </>
}

export default NavBar
